import  React from 'react'
import {
    Link,
    useRouteMatch
  } from "react-router-dom";

function Nav(){
    let { url } = useRouteMatch();
    return(
        <nav>
        <Link to={`${url}application/info`}>Info<br/></Link>
        <Link to={`${url}application/toodos`}>Toodos<br/></Link>
        <Link to={`${url}application/posts`}>Posts<br/></Link>
        <Link to={`${url}application/albums`}>Albums<br/></Link>
        </nav>
    )
}
export default Nav;
